/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tr_aprobaciones_servicios_insert` AFTER INSERT ON `aprobaciones_servicios` FOR EACH ROW BEGIN
    DECLARE servicio_nombre VARCHAR(255);
    DECLARE departamento_nombre VARCHAR(255);

    -- Obtener el nombre del servicio hospitalario utilizando el ID de la nueva fila
    SELECT Nombre INTO servicio_nombre FROM servicios_hospitalarios WHERE ID = NEW.Servicio_Paciente_ID;

    -- Obtener el nombre del departamento utilizando el ID del departamento solicitante
    SELECT Nombre INTO departamento_nombre FROM departamentos WHERE id = NEW.Departamento_Solicitante;

    -- Insertar en la tabla de bitácora con detalles adicionales
    INSERT INTO bitacora_dg (Nombre_Tabla, Usuario, Operacion, Descripcion, Fecha_Hora)
    VALUES ('aprobaciones_servicios', USER(), 'Insert',
            CONCAT('Se ha agregado una nueva fila en la tabla aprobaciones_servicios con el ID:', NEW.ID, 
                   ', Servicio: ', servicio_nombre, 
                   ', Departamento Solicitante: ', departamento_nombre, 
                   ', Fecha de Solicitud: ', NEW.Fecha_Solicitud,
                   ', Estatus: ', NEW.Estatus), 
            NOW());
END */;;
DELIMITER ;
