/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tr_aprobaciones_servicios_update` AFTER UPDATE ON `aprobaciones_servicios` FOR EACH ROW BEGIN
    DECLARE servicio_nombre_old VARCHAR(255);
    DECLARE departamento_nombre_old VARCHAR(255);
    DECLARE servicio_nombre_new VARCHAR(255);
    DECLARE departamento_nombre_new VARCHAR(255);

    -- Obtener el nombre del servicio hospitalario utilizando el ID de la fila antes de la actualización
    SELECT Nombre INTO servicio_nombre_old FROM servicios_hospitalarios WHERE ID = OLD.Servicio_Paciente_ID;

    -- Obtener el nombre del departamento utilizando el ID del departamento solicitante antes de la actualización
    SELECT Nombre INTO departamento_nombre_old FROM departamentos WHERE id = OLD.Departamento_Solicitante;

    -- Obtener el nombre del servicio hospitalario utilizando el ID de la fila después de la actualización
    SELECT Nombre INTO servicio_nombre_new FROM servicios_hospitalarios WHERE ID = NEW.Servicio_Paciente_ID;

    -- Obtener el nombre del departamento utilizando el ID del departamento solicitante después de la actualización
    SELECT Nombre INTO departamento_nombre_new FROM departamentos WHERE id = NEW.Departamento_Solicitante;

    -- Insertar en la tabla de bitácora con detalles adicionales
    INSERT INTO bitacora_dg (Nombre_Tabla, Usuario, Operacion, Descripcion, Fecha_Hora)
    VALUES ('aprobaciones_servicios', USER(), 'Update',
            CONCAT('Se ha actualizado una fila en la tabla aprobaciones_servicios. ID antiguo:', OLD.ID, 
                   ', Servicio Antiguo: ', servicio_nombre_old, 
                   ', Departamento Solicitante Antiguo: ', departamento_nombre_old,
                   ', Estatus Antiguo: ', OLD.Estatus,
                   ' ID nuevo: ', NEW.ID,
                   ', Servicio Nuevo: ', servicio_nombre_new, 
                   ', Departamento Solicitante Nuevo: ', departamento_nombre_new,
                   ', Estatus Nuevo: ', NEW.Estatus), 
            NOW());
END */;;
DELIMITER ;
