/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tr_personal_medico_update` AFTER UPDATE ON `personal_medico` FOR EACH ROW BEGIN
    INSERT INTO bitacora_dg (nombre_tabla, Usuario, operacion, descripcion, fecha_hora)
    VALUES ('personal_medico', USER(), 'update', 
    CONCAT('Se ha actualizado un registro en personal_medico con el ID:', NEW.Persona_id,
    '. Cambios realizados:',
    IF(OLD.especialidad <> NEW.especialidad, CONCAT(' Especialidad: ', OLD.especialidad, ' -> ', NEW.especialidad), ''),
    IF(OLD.tipo <> NEW.tipo, CONCAT(' Tipo: ', OLD.tipo, ' -> ', NEW.tipo), ''),
    IF(OLD.cedula_profesional <> NEW.cedula_profesional, CONCAT(' Cédula Profesional: ', OLD.cedula_profesional, ' -> ', NEW.cedula_profesional), ''),
    IF(OLD.estatus <> NEW.estatus, CONCAT(' Estatus: ', OLD.estatus, ' -> ', NEW.estatus), ''),
    IF(OLD.fecha_contratacion <> NEW.fecha_contratacion, CONCAT(' Fecha de Contratación: ', OLD.fecha_contratacion, ' -> ', NEW.fecha_contratacion), ''),
    IF(OLD.fecha_terminacion_contrato <> NEW.fecha_terminacion_contrato, CONCAT(' Fecha de Terminación de Contrato: ', OLD.fecha_terminacion_contrato, ' -> ', NEW.fecha_terminacion_contrato), '')
    ),
    NOW());
END */;;
