/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tr_persona_insert` AFTER INSERT ON `personas` FOR EACH ROW BEGIN
    INSERT INTO bitacora_dg (nombre_tabla, Usuario, operacion, descripcion, fecha_hora) 
    VALUES ('personas', USER(), 'insert', 
    CONCAT('Se ha agregado una nueva persona con el ID:', NEW.id, 
    ', con los siguientes datos: Nombre:', NEW.Nombre, 
    ', Primer Apellido:', NEW.Primer_Apellido, 
    ', Segundo Apellido:', COALESCE(NEW.Segundo_Apellido, 'N/A'), 
    ', CURP:', COALESCE(NEW.CURP, 'N/A'), 
    ', Género:', NEW.Genero, 
    ', Grupo Sanguíneo:', NEW.Grupo_Sanguineo, 
    ', Tipo Sanguíneo:', NEW.Tipo_Sanguineo, 
    ', Fecha de Nacimiento:', NEW.Fecha_Nacimiento,
    ', Estatus:', NEW.Estatus), 
    NOW());
END */;;
