/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tr_persona_update` AFTER UPDATE ON `personas` FOR EACH ROW BEGIN
    INSERT INTO bitacora_dg (nombre_tabla, Usuario, operacion, descripcion, fecha_hora) 
    VALUES ('personas', USER(), 'update', 
    CONCAT('Se ha actualizado la persona con el ID:', NEW.id, 
    '. Cambios realizados: ',
    IF(OLD.Nombre <> NEW.Nombre, CONCAT('Nombre: ', OLD.Nombre, ' -> ', NEW.Nombre), ''),
    IF(OLD.Primer_Apellido <> NEW.Primer_Apellido, CONCAT('Primer Apellido: ', OLD.Primer_Apellido, ' -> ', NEW.Primer_Apellido), ''),
    IF(OLD.Segundo_Apellido <> NEW.Segundo_Apellido, CONCAT('Segundo Apellido: ', COALESCE(OLD.Segundo_Apellido, 'N/A'), ' -> ', COALESCE(NEW.Segundo_Apellido, 'N/A')), ''),
    IF(OLD.CURP <> NEW.CURP, CONCAT('CURP: ', COALESCE(OLD.CURP, 'N/A'), ' -> ', COALESCE(NEW.CURP, 'N/A')), ''),
    IF(OLD.Genero <> NEW.Genero, CONCAT('Género: ', OLD.Genero, ' -> ', NEW.Genero), ''),
    IF(OLD.Grupo_Sanguineo <> NEW.Grupo_Sanguineo, CONCAT('Grupo Sanguíneo: ', OLD.Grupo_Sanguineo, ' -> ', NEW.Grupo_Sanguineo), ''),
    IF(OLD.Tipo_Sanguineo <> NEW.Tipo_Sanguineo, CONCAT('Tipo Sanguíneo: ', OLD.Tipo_Sanguineo, ' -> ', NEW.Tipo_Sanguineo), ''),
    IF(OLD.Fecha_Nacimiento <> NEW.Fecha_Nacimiento, CONCAT('Fecha de Nacimiento: ', OLD.Fecha_Nacimiento, ' -> ', NEW.Fecha_Nacimiento), ''),
    IF(OLD.Estatus <> NEW.Estatus, CONCAT('Estatus: ', OLD.Estatus, ' -> ', NEW.Estatus), '')
    ), 
    NOW());
END */;;
DELIMITER ;
