CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_limpia_bd`(v_password VARCHAR(20))
BEGIN  IF v_password = "1234" THEN
		
DELETE FROM aprobaciones_servicios;
alter table aprobaciones_servicios auto_increment = 1;

DELETE FROM servicios_hospitalarios;  -- Tabla Débil
alter table servicios_hospitalarios auto_increment = 1;

DELETE FROM pacientes;  -- Tabla Débil
alter table pacientes auto_increment = 1;

DELETE FROM personal_medico;  -- Tabla Débil
alter table personal_medico auto_increment = 1;

DELETE FROM personas;  -- Tabla Fuerte 
alter table personas auto_increment = 1;

	ELSE 
		SELECT ("La contraseña es incorrecta.") AS ErrorMessage;
        
	END IF;
END ;;
